import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div className="case">
        <div className="phone">
        <div className="item1">
                    <div id="clock" className="time"></div>
                    <div className="camera">
                        <div className="cam"></div>
                    </div>
                    <div className="battery">30%</div>
                </div>
        </div>
      </div>


      </header>
    </div>
  );
}

export default App;
